import './nav.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
function Nav() {
  return (
  	<nav>

  	<ul className="menu">

    <li className="item">
    <Link to="/">Home</Link>
    </li>

    <li className="item">
    <Link to="/equipo">Equipo</Link>
    </li>
    <li className="item">
    <Link to="/servicios">Servicios</Link>
    </li>
    <li className="item"><a href="#">Agenda tu cita</a></li>
    <li className="item"><a href="#">Contactenos</a></li>
    
    </ul>
  
  	</nav>
  );
} 

export default Nav;
